import React, { useState } from "react";

// Custom Hook for handling hover effect
const useHover = () => {
  const [isHovered, setIsHovered] = useState(false);
  return {
    isHovered,
    onMouseEnter: () => setIsHovered(true),
    onMouseLeave: () => setIsHovered(false),
  };
};

// Custom Hook for toggling password visibility
const usePasswordToggle = () => {
  const [showPassword, setShowPassword] = useState(false);
  return {
    showPassword,
    togglePassword: () => setShowPassword(!showPassword),
  };
};

const SignInButton = ({ onClick }) => {
  const hover = useHover();
  return (
    <button
      style={{
        ...styles.signInButton,
        transform: hover.isHovered ? "scale(1.05)" : "scale(1)",
      }}
      {...hover}
      onClick={onClick}
    >
      SIGN IN
    </button>
  );
};

const SignUpButton = ({ onClick }) => {
  const hover = useHover();
  return (
    <button
      style={{
        ...styles.signUpButton,
        background: hover.isHovered ? "#f3f3f3" : "#fff",
        transform: hover.isHovered ? "scale(1.05)" : "scale(1)",
      }}
      {...hover}
      onClick={onClick}
    >
      SIGN UP
    </button>
  );
};

const LoginPage = () => {
  const passwordToggle = usePasswordToggle();

  return (
    <div style={styles.container}>
      <div style={styles.leftSection}>
        <h2 style={styles.title}>Login in to Your Account</h2>
        <div style={styles.socialIcons}>
          <a href="https://www.facebook.com" target="_blank" rel="noopener noreferrer" style={styles.iconCircle}>
            <i className="fab fa-facebook-f"></i>
          </a>
          <a href="https://www.google.com" target="_blank" rel="noopener noreferrer" style={styles.iconCircle}>
            <i className="fab fa-google"></i>
          </a>
          <a href="https://www.linkedin.com" target="_blank" rel="noopener noreferrer" style={styles.iconCircle}>
            <i className="fab fa-linkedin-in"></i>
          </a>
        </div>
        <p style={styles.orText}>or use your email:</p>
        <div style={styles.inputContainer}>
          <div style={styles.inputWrapper}>
            <i className="fas fa-envelope" style={styles.inputIcon}></i>
            <input type="email" placeholder="Email" style={styles.input} />
          </div>
          <div style={styles.inputWrapper}>
            <i className="fas fa-lock" style={styles.inputIcon}></i>
            <input
              type={passwordToggle.showPassword ? "text" : "password"}
              placeholder="Password"
              style={styles.input}
            />
            <span style={styles.eyeIcon} onClick={passwordToggle.togglePassword}>
              {passwordToggle.showPassword ? "🙈" : "👁️"}
            </span>
          </div>
        </div>
        <p style={styles.forgotPassword}>Forgot your password?</p>
        <SignInButton />
      </div>

      <div style={styles.divider}></div>

      <div style={styles.rightSection}>
        <h1 style={styles.signupTitle}>New Here?</h1>
        <h2 style={styles.signupText}>Sign up and discover a great amount of educational events!</h2>
        <SignUpButton />
      </div>
    </div>
  );
};

const styles = { /* Same styles as in your original code */ };

export default LoginPage;
